window.bookSummaryJSON = "<p><b>Crowns come with a steep price.</b></p> <p>On the surface, Reshner is experiencing a time of peace and prosperity, but trouble is brewing.&nbsp;</p> <p><i>Reshner’s Royal Ranger</i>: Prince Terosh goes on an epic journey to prove himself as a man. Reia Antellio does everything in her power to protect the prince.&nbsp;</p> <p><i>Reshner’s Royal Threat</i>: The political threats facing the royals spill over into violence.&nbsp;</p> <p><i>Reshner’s Royal Guard</i>: The Royal House falters, but hope remains.&nbsp;</p> <p>The Royal House faces threats from without and within. Even the anotechs - fabled god-machines - will be hard-pressed to save the royals this time.&nbsp;</p> <p>The Anotech Chronicles series is epic science fiction. We’re talking maps, glossaries, a whole new world, and a lot of characters. If that scares you, check out some of my tamer series. If this is your thing, give it a go.</p>"; 
